<span class="line"><span style="color:#A6ACCD;">console</span><span style="color:#89DDFF;">.</span><span style="color:#82AAFF;">log</span><span style="color:#A6ACCD;">(number</span><span style="color:#89DDFF;">++</span><span style="color:#A6ACCD;">)</span></span>
